import './Navbar.css';

document.querySelectorAll('a[href^="#"]').forEach(anchor => {
    anchor.addEventListener('click', function (e) {
        e.preventDefault();

        document.querySelector(this.getAttribute('href')).scrollIntoView({
            behavior: 'smooth'
        });
    });
  });

function Navbar () {
    return (
        <div>
            <a className="navbar" href="#header">Home</a>
            <a className="navbar" href="#startSection01">Section 01</a>
            <a className="navbar" href="#startSection02">Section 02</a>
        </div>
    );
}

export default Navbar;
